[{"header":{"type":"esummary","version":"0.3"},"result":{"uids":["5787"],"5787":{"uid":"5787","name":"PTPRB","description":"protein tyrosine phosphatase receptor type B","status":"","currentid":"","chromosome":"12","geneticsource":"genomic","maplocation":"12q15","otheraliases":"HPTP-BETA, HPTPB, PTPB, R-PTP-BETA, VEPTP","otherdesignations":"receptor-type tyrosine-protein phosphatase beta|VE-PTP|protein tyrosine phosphatase, receptor type, beta polypeptide|vascular endothelial protein tyrosine phosphatase","nomenclaturesymbol":"PTPRB","nomenclaturename":"protein tyrosine phosphatase receptor type B","nomenclaturestatus":"Official","mim":["176882"],"genomicinfo":[{"chrloc":"12","chraccver":"NC_000012.12","chrstart":70637428,"chrstop":70515869,"exoncount":37}],"geneweight":3163,"summary":"The protein encoded by this gene is a member of the protein tyrosine phosphatase (PTP) family. PTPs are known to be signaling molecules that regulate a variety of cellular processes including cell growth, differentiation, mitotic cycle, and oncogenic transformation. This PTP contains an extracellular domain, a single transmembrane segment and one intracytoplasmic catalytic domain, thus belongs to receptor type PTP. The extracellular region of this PTP is composed of multiple fibronectin type_III repeats, which was shown to interact with neuronal receptor and cell adhesion molecules, such as contactin and tenascin C. This protein was also found to interact with sodium channels, and thus may regulate sodium channels by altering tyrosine phosphorylation status. The functions of the interaction partners of this protein implicate the roles of this PTP in cell adhesion, neurite growth, and neuronal differentiation. Alternate transcript variants encoding different isoforms have been found for this gene. [provided by RefSeq, May 2011]","chrsort":"12","chrstart":70515869,"organism":{"scientificname":"Homo sapiens","commonname":"human","taxid":9606},"locationhist":[{"annotationrelease":"RS_2024